import './App.css';
import KeyJson from './keys.json';

const App = () => {

  const onSelect = () => {
    console.log('Check-->', )
  }

  return (
    <div className="container text-center align-items-center">
      <div className="row m-1">
        {
          KeyJson.map(k => <div className="col-2" key={k.key} onClick={() => onMove(k)}>{k.value}</div>)
        }
      </div>
    </div>
  );
}

export default App;
